import React from 'react';

const Footer = () =>
{
    return(
        <footer className="site-footer">
            <div className="container">
                <img src='./dummy/logo-footer.png' alt="Site Name"></img>
                <address><p>1234 YouTube Lane, Columbus OH</p></address>
                <p class="copy">Copyright 2021 YouTube.Live, Designed by Mo Ager, Anthony DeCapite, Morgan Schall, Kyle Young and Ryan Evans. All rights reserved</p>
            </div>
        </footer>
    )
}

export default Footer;
